import { useEffect, useState } from "react";
import { StyledBackground } from "./styled";
import { TokenNames } from "../../types";

const getBackground = (token: string) => {
  switch (token) {
    case TokenNames.scrt:
      return "#151A20";
    case TokenNames.atom:
      return "#231C28";
    case TokenNames.lunc:
      return "#29230A";
    case TokenNames.ust:
      return "#111D31";
    case TokenNames.osmo:
      return "#2D0028";
    case TokenNames.dvpn:
      return "#002532";
    case TokenNames.huahua:
      return "#30220D";
    case TokenNames.juno:
      return "#f0827d";
    case TokenNames.akt:
      return "#310F09";
    case TokenNames.luna:
      return "#DF3833";
    case TokenNames.gravity:
      return "#012EA7";
    case TokenNames.evmos:
      return "#ED4F32";
  }
};

